import PropTypes from 'prop-types'

function Header({ text }) {


  return (
    <header style={{ backgroundColor: "blue", color: "red"}}>
        <div className="container">
            <h2>{text}</h2>
        </div>
    </header>
  )
}

Header.defaultProps = {
    text: 'Feedback UI',
}

Header.propTypes = {
    text: PropTypes.string,
}

export default Header
